<p>HTTPS (Hypertext Transfer Protocol Secure)是 HTTP 的安全版本。它使用 SSL/TLS (安全套接字层/传输层安全)对 web 服务器和客户端之间传输的数据进行加密，使攻击者更难以拦截、读取或修改数据。HTTPS 广泛用于互联网上的安全通信，特别是在传输密码、信用卡详细信息或个人信息等敏感信息时。</p>
